import React, { useState } from 'react';
import './App.css';

function App() {
  const [count, setCount] = useState(0);

  return (
    <div className="App" style={{backgroundColor:'transparent'}}>
      <header className="App-header">
        <h1>Welcome to My React App</h1>
        
      </header>
    </div>
  );
}

export default App;
